import React from 'react';
import NavBar from '../components/NavBar';
import '../styles/App.css';
import "../styles/Home.css";
import Sections from '../components/Sections';
import { Routes } from 'react-router-dom';

function App() {

  return (
  <div className="catalog">
    <NavBar/>
    <Routes>

    <Sections/>
    </Routes>
  </div>
  );
}

export default App;
